const mongoose = require("mongoose");
const findOrCreate = require("mongoose-find-or-create");
const EmployeeSchema = new mongoose.Schema({
  name: {
    type: String,
    required: true,
  },
  address: {
    type: String,
    required: true,
  },
  email: {
    type: String,
    required: true,
    unique: true, // Unique Email for each user
  },
  avatar: {
    type: String,
    default:
      "",
  },
  serviceList: {
    //Service List
    type: Array,
    default: [],
    required: true,
  },
  history: {
    //order history
    type: Array,
    default: [],
  },
  employeeID: {
    type: String,
    required: true,
    unique: true, // Unique ID for each user
  },
});
EmployeeSchema.plugin(findOrCreate);
module.exports = Employee = mongoose.model("employees", EmployeeSchema);
